import React from "react";
import "./footer.css";
import { Container, Row, Col, ListGroup, ListGroupItem } from "reactstrap";

import { Link } from "react-router-dom";
import logo from "../../assets/images/logotouru.png";

const quick__links = [
  {
    path: "/home",
    display: "Beranda",
  },
  {
    path: "/tours",
    display: "Tour Guide",
  },
  {
    path: "/homestay",
    display: "Homestay",
  },
];

const quick__links2 = [
  {
    path: "/galerry",
    display: "Gallery",
  },
  {
    path: "/login",
    display: "Login",
  },
  {
    path: "/register",
    display: "Register",
  },
];

const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row>
          <Col lg="3">
            <div className="logo">
              <img src={logo} alt="" />
            </div>
          </Col>
        </Row>
      </Container>
    </footer>
  );
};

export default Footer;
